var selectedZone = "torse";
var displayed = {
    torse:0,
    dos:0,
    tete:0,
    cou:0,
    brasdroit:0,
    brasgauche:0,
    jambedroite:0,
    jambegauche:0
};

init(true);

function init(isMale){
    var ss = document.getElementsByClassName("svgbodypart");
    for(var i=0; i<ss.length; i++){
        if(!["ventre","body"].includes(ss[i].id)){
            ss[i].addEventListener('click', function(e){
                selectedZone = e.target.id; //tattoo[isMale?'M':'F'][selectedZone];
                var sz = document.getElementById("selectedZone");
                sz.innerHTML = e.target.dataset.name;
                sz.style.color = "#ffffff";
                document.getElementById("navBox").style.display = "block";
                document.getElementById("acheterButtonBox").style.display = "block";
                var ss = document.getElementsByClassName("selectedbodypart");
                for(var i=0; i<ss.length; i++) ss[i].classList.remove("selectedbodypart");
                e.target.classList.add("selectedbodypart");
                document.getElementById("navText").innerHTML = `${displayed[selectedZone]+1} / ${tattoo[isMale?'M':'F'][selectedZone].length}`;
            });
        }
    }

    // navArrow gauche
    document.getElementById("navArrow-L").addEventListener("click", function(e){
        displayed[selectedZone] = (displayed[selectedZone]-1) % tattoo[isMale?'M':'F'][selectedZone].length;
        if(displayed[selectedZone]<0) displayed[selectedZone] = tattoo[isMale?'M':'F'][selectedZone].length-1;
        document.getElementById("navText").innerHTML = `${displayed[selectedZone]+1} / ${tattoo[isMale?'M':'F'][selectedZone].length}`;
    });

    // navArrow droite
    document.getElementById("navArrow-R").addEventListener("click", function(e){
        displayed[selectedZone] = (displayed[selectedZone]+1) % tattoo[isMale?'M':'F'][selectedZone].length;
        if(displayed[selectedZone]<0) displayed[selectedZone] = tattoo[isMale?'M':'F'][selectedZone].length-1;
        document.getElementById("navText").innerHTML = `${displayed[selectedZone]+1} / ${tattoo[isMale?'M':'F'][selectedZone].length}`;
    });

    // Acheter
    document.getElementById("acheterButtonBox").addEventListener('click', function(e){
        document.getElementById("checkout").play();
        alert(JSON.stringify(
            tattoo[isMale?'M':'F'][selectedZone][displayed[selectedZone]]
        ));
    });
}
